ブームマットは車両における振動やノイズを簡単に抑えることが出来るマットです。取り付け表面を選ばず、必要な大きさ、形にカットして貼付け可能です。ゴムを主原料とした特殊ポリマーを使用し、外側にアルミホイルを貼りつけた2層構造です。マットの裏側には耐腐食性、寒暖の影響を受けない接着剤が貼ってあり、あらゆる素材に貼り付け可能です。 <br>DEIは1995年にアメリカ オハイオ州で創業。エンジン等から発生する熱をチューニングして車のパフォーマンスを向上させる為に150点以上の製品を提供しています。SCCA・SEMAの会員でも有りレースからストリートまで幅広いユーザーから指示されているメーカーです。<br><br>■サイズ：12インチX23インチ（304mmX584mm）　■枚数：10 <br>汎用品 <br>　<br>エンジンパーツ/エンジンパーツその他<tr><td colspan="2">
